import React from "react";
import styled from "styled-components";
import ButtonShell from "./SideMenuButton";
import D20Icon from "../Images/Dice/D20Icon";

const StandardD20Icon = <D20Icon color={"#662d91"} />;
//const ActiveD20Icon = <D20Icon color={"#AF70E0"} />;

const Button = styled.div`
  &:hover {
    cursor: pointer;
  }
`;

const ButtonOutline = styled(ButtonShell)`
  top: 75vh;
`;

const DiceIcon = styled(D20Icon)`
  width: 35px;
  position: fixed;
  left: 39px;
  top: 76.1vh;
`;

const SDiceIcon = styled(StandardD20Icon)`
  width: 35px;
  position: fixed;
  left: 39px;
  top: 76.1vh;
`;

const RollButton = (props) => {
  if (props.active) {
    return (
      <Button>
        <ButtonOutline />
        <SDiceIcon />
      </Button>
    );
  } else {
    return (
      <Button>
        <ButtonOutline />
        <DiceIcon />
      </Button>
    );
  }
};

export default RollButton;
